import React from "react";
import { Counter } from "./features/counter/Counter";
import { Login } from "./screens";
import "./App.css";
import { ThemeProvider } from "styled-components";
import theme from "./theme";

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <Login />
      </div>
    </ThemeProvider>
  );
}

export default App;
